public class DatabasePreset {
    private final String driver;
    private final String url;
    private final String username;
    private final String password;
    private final String database;
    private final String tablePrefix;
    private final ConfigSection parameters;

    public DatabasePreset(String driver, String url, String username, String password, String database, String tablePrefix, ConfigSection parameters) {
        this.driver = driver;
        this.url = url;
        this.username = username;
        this.password = password;
        this.database = database;
        this.tablePrefix = tablePrefix;
        this.parameters = parameters;
    }

    public String driver() {
        return driver;
    }

    public String url() {
        return url;
    }

    public String username() {
        return username;
    }

    public String password() {
        return password;
    }

    public String database() {
        return database;
    }

    public String tablePrefix() {
        return tablePrefix;
    }

    public ConfigSection parameters() {
        return parameters;
    }
